import img1 from '../../images/banner/1.jpg'
import img2 from '../../images/banner/2.jpg'
import img3 from '../../images/banner/3.jpg'
import img4 from '../../images/banner/5.jpg'
import img5 from '../../images/banner/7.jpg'
import img6 from '../../images/banner/8.jpg'
import Slider from "react-slick";
// import { baseUrl } from "./config";
// import "slick-carousel/slick/slick.css"; 
// import "slick-carousel/slick/slick-theme.css";

import React from 'react'

function Banner() {

  const bannerImgs = [
    {
      id : 1,
      src : img1
    },
    {
      id : 2,
      src : img2
    },
    {
      id : 3,
      src : img3
    },
    {
      id : 4,
      src : img4
    },
    {
      id : 5,
      src : img5
    },
    {
      id : 6,
      src : img6
    },
  ]

  const settings = {
    dots: true,
    lazyLoad: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    initialSlide: 2
  };

  return (
    <div className="banner">
      {
        bannerImgs.map(banner => (
          <Slider {...settings}>
            <div key={banner.id}>
              <img src='../../images/banner/1.jpg' alt="" />
            </div>
        </Slider>
        ))
      }
    </div>
  )
}

export default Banner
